import React from 'react'

export default function Sortby(props) {
  return (
    <form className="sort flex align-center">
                  <p><b>Sort By</b></p>
                  <select name="sort-by-filter" id="sort-by-filter">
                     <option value="Relevance">{props.sort[0]}</option>
                     <option value="Price">{props.sort[1]}</option>
                     <option value="Popularity">{props.sort[2]}</option>
                  </select>
               </form>
  )
}
